description:
Dr. R.C. Sproul: Ancient Hebrew names were more than arbitrary tags. They meant something. The names of God in the Old Testament help us to see various important aspects of His nature. The God We Worship is an intriguing study of God's character traits as revealed by His titles. 

************************************************************************************

Language: English / Video Format: FLV

1 The God We Worship
2 What Can We Know About God
3 Yahweh - The Name of God
4 Adonai - God Is Lord
5 Elohim - God's Plural Name
6 El Shaddai - God of Power

